#
# TABLE STRUCTURE FOR: round_diamonds
#

DROP TABLE IF EXISTS `round_diamonds`;

CREATE TABLE `round_diamonds` (
  `key_id` int(11) NOT NULL AUTO_INCREMENT,
  `shape` varchar(255) NOT NULL DEFAULT 'BR',
  `lab` varchar(3) NOT NULL DEFAULT 'GIA',
  `size` float DEFAULT NULL,
  `color` varchar(255) DEFAULT NULL,
  `clarity` varchar(255) DEFAULT NULL,
  `giadate` date DEFAULT NULL,
  `gianumber` varchar(255) DEFAULT NULL,
  `measurements` varchar(255) DEFAULT NULL,
  `ratio` float DEFAULT -0,
  `depth` int(5) DEFAULT NULL,
  `table` int(5) DEFAULT NULL,
  `girdle` varchar(255) DEFAULT NULL,
  `cut` varchar(255) DEFAULT NULL,
  `polish` varchar(255) DEFAULT NULL,
  `symmetry` varchar(255) DEFAULT NULL,
  `culet` varchar(255) DEFAULT NULL,
  `fluorescence` varchar(255) DEFAULT NULL,
  `comments` varchar(255) DEFAULT NULL,
  `pricepercarat` float DEFAULT NULL,
  `orgprice` float DEFAULT NULL,
  `disc` float DEFAULT NULL,
  `person` varchar(255) DEFAULT NULL,
  `datebought` date DEFAULT NULL,
  `datesold` date DEFAULT NULL,
  `soldby` varchar(255) DEFAULT NULL,
  `rapaport_shape` varchar(10) DEFAULT 'BR',
  `orig_disc` float DEFAULT NULL,
  PRIMARY KEY (`key_id`)
) ENGINE=MyISAM AUTO_INCREMENT=101 DEFAULT CHARSET=utf8;



